import React from 'react';
import { AppBar, Toolbar, Typography } from '@material-ui/core';

const Header = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6">
          English Quiz - Fill in the Blanks
        </Typography>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
